import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react';
import './App.css';
import Nav from './components/layout/Nav';
import Landing from './components/layout/Landing';
import './App.css';

const App = () => (
    <Router>
      <Nav/>
      <Router exact path='/' component={Landing}/>
    </Router>
)

export default App;
